import axiosConfig from './axiosConfig';
import './CSS/Home.css'
import Navigation from "./Navigation";

const Profile = () => {
    let[posts, setPosts] = useState([]);

    useEffect(()=>{
        axiosConfig.get("profile")
        .then(resp=>{
            console.log(resp.data);
        }).catch(err=>{
            console.log(err);
        });
    },[]);

    return (
        <div>
            <Navigation />
            <div className="profile">
                <h1>Profile</h1>
            </div>
        </div>
    );
}

export default Profile;
